    "A Survey of the Former Champion International Lands in Essex County, VT for Rare,
    Threatened, and Endangered Reptiles and Amphibians",nt"tracking_summary": {ntt"total":
    3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:03:58.834234",nt"name": "a-survey-of-the-former-champion-international-lands-in-essex-county-vt-for-rare-threatened",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this effort was. to perform
    a herpetological survey of two portions (Conte NWR & West Mt. WMA) of the former
    lands of Champion International Inc., in Essex County, Vermont. The goals of the
    survey were to locate any rare, threatened, or endangered reptiles or amphibians,
    perform general herpetological surveys at selected sites, and note any communal
    amphibian breeding sites and vernal pools located during the survey. The author
    reports on all reptiles and amphibians (herptiles) located in the study (Tables
    1-4) paying particular attention to those with a Vermont State Heritage rank of
    S3 or lower and/or a global rank of G4 or lower. All communal breeding sites and
    vernal pools are scored based on productivity and diversity, shown on maps (Figures
    1 through 4) and briefly described. Results of surveys of the nearby and selected
    sites are shown in Tables 5 through 23. Those species reported in interviews but
    not located during the survey are shown in Table 24.",nt"license_title": "License
